window.bookSummaryJSON = "<p>Violet Parker has big troubles these days—the ticking kind. To duck the Grim Reaper, she needs to get her hands on eighty-plus rare, mystical clocks locked up tight by a thick-headed detective.</p> <p>The solution? Hijack the truckload of ticking time bombs out from under Johnny Law’s nose.</p> <p>But no caper ever goes according to plan. What starts out as a game of clocks and robbers twists and turns into a chaos of cops and clobbers.</p> <p>Will Violet beat the detective in time? Or will she spend Valentine’s Day behind bars?</p>"; 
